import React from 'react'
import './UserProfile.css'
import { Card, CardContent, CardActions, Button, makeStyles, CardHeader, Avatar } from '@material-ui/core'
import avatar from 'assets/images/logo.png'
import FormInput from 'components/common/input/FormInput'

const useStyles = makeStyles({
  root: {
    maxWidth: 600
  },
  avatar: {
    backgroundColor: '#fff'
  },
  media: {
    height: 140
  }
})

function UserProfile() {
  const classes = useStyles()

  return (
    <div className="profile">
      <Card className={classes.root}>
        <CardHeader avatar={<Avatar aria-label="recipe" className={classes.avatar} src={avatar} alt={'logo'} />} />
        <CardContent>
          <form noValidate autoComplete="off" style={{ display: 'flex', flexDirection: 'column' }}>
            <FormInput label="Email" />
            <FormInput label="Username" />
            <FormInput label="Address" />
            <FormInput label="Phone" />
          </form>
        </CardContent>
        <CardActions>
          <Button size="small" color="primary">
            Update profile
          </Button>
        </CardActions>
      </Card>
    </div>
  )
}

export default UserProfile
